// import "./App.css";
import "../styles/"
import { Route, Routes } from "react-router-dom";
import Layout from "./Layout";
import Homepage from "../pages/Homepage";
import Login from "../pages/Login";
function App() {
    return (

        <Routes>
            <Route path="/" element={<Layout />}>

                <Route index element={
                    <Homepage />
                } />
                <Route path={'/login'} element={
                    <Login />

                } />



            </Route>

        </Routes>


    );
}

export default App;
